    public static float getMin(float[] arr) {
        float min = arr[0];
        for (float v : arr) {
            if (min > v) {
                min = v;
            }
        }
        return min;
    }

    public static float getMax(float[] arr) {
        float max = arr[0];
        for (float v : arr) {
            if (max < v) {
                max = v;
            }
        }
        return max;
    }

