    public static float[] convert(String[] arr) throws NumberFormatException {
        float[] fArr = new float[arr.length];

        for (int i = 0; i < arr.length; i++) {
            fArr[i] = Float.parseFloat(arr[i]);
        }
        return fArr;
    }

    public static Map<Integer, ArrayList<Float>> get(float[] arr) {
        //0     0     31
        //1     32    63
        //2     64    95
        //3     96    127
        //4     128   159

        Map<Integer, ArrayList<Float>> map = new HashMap<>();

        for (int i = 0; i < arr.length / 32; i++) {

            int startIndex = i * 32;
            int endIndex = (i + 1) * 32;
            Log.d(TAG, startIndex + " ~ " + endIndex);

//            String line = "";
            for (int j = startIndex; j < endIndex; j++) {
//                line += arr[j] + ",";

                ArrayList<Float> list = map.get(i);
                if (list == null) {
                    list = new ArrayList<>();
                    list.add(arr[j]);
                    map.put(i, list);
                } else {
                    list.add(arr[j]);
                }
            }
//            Log.d(TAG, "Line: " + line);
        }
        return map;
    }

